import '../css/app.css';
import Header from '../../header';
import Top from './Top';
import About from './About';
import Skill from './Skill';

function Home() {

    const [topPage, setTopPage] = useState<boolean>(true);
    const [other, setOther] = useState<boolean>(false);

  return (
    <>
        { other && <Header />}
        { topPage && <Top />}
        { other && 
        <div>
            <About />
            <Skill />
        </div>
        }

    </>
  );
}

export default Home;
